import React, { useState } from 'react';
import Paper from '@mui/material/Paper';
import PersonIcon from '@mui/icons-material/Person';
import AddCircleIcon from '@mui/icons-material/AddCircle';
import Stack from '@mui/material/Stack';
import axios from 'axios';
import { Button, Icon, Link, TextField, Typography } from '@mui/material';

const LoginForm = () => {
    const getAPI = async ()=>{
        try{
            const result = await axios.get('http://localhost:5000/');
            console.log("Get API Result: ", result.data);            
        }catch(error){
            console.error(error);
        }
    }

    const loginPOST = async (values)=>{
        try{
            console.log("Started with POST API");
            const response = await axios.post("http://localhost:5000/", values);
            console.log(response.data);
        }catch(error){
            console.error("Error observer with loginPOST API", error);
        }
    }

    const onFinish = (values)=>{
        console.log('Success: ', values);
        loginPOST(values);
    }

    const onFinishFailed = (error)=>{
        console.log('Failed: ', error);
    }

    const [email, setEmail] = useState('');
    const [password, setPassword] = useState('');

    const handleEmailChange = (event)=>{
        setEmail = event.target.value;
    }

    const handlePassChange = (event) =>{
        setPassword = event.target.value;
    }

   return(
    <Paper className='loginFormContainer' elevation={20}>
        <div className='loginIcon'>
            <PersonIcon fontSize='medium' color='primary'  />
            <Typography variant='h5'>Login</Typography>
        </div>
        <div className='loginFields'>
            <TextField label='Email Address' name='email' type='text' onChange={handleEmailChange}></TextField>
            <TextField label='Password' name='password' type='password' onChange={handlePassChange}></TextField>
        </div>
        <div className='loginButton'>
            <Link label='Forgot Password'><Typography variant='body2'>Forgot Password</Typography></Link>
            <Button type='submit' variant='contained'>Login</Button>
        </div>
    </Paper>
   ) 
}

export default LoginForm;
